import './List.css'
import Checkbox from '../Checkbox/Checkbox';

const List = (props) => {
  return (
    <Card className="background-color:#b1c3d9">
        <Checkbox></Checkbox>
        <div>{props.rarity}</div>
        <div>{props.hexcode}</div>
    </Card>
  );
};

export default List;
